class Solution {

    /**
     * @param Integer $n
     * @param String[] $words
     * @param Integer[] $groups
     * @return String[]
     */
    function getWordsInLongestSubsequence($n, $words, $groups) {
        $dp = array_fill(0, $n, 1);
        $prev = array_fill(0, $n, -1);
        $maxLength = 1;
        $lastIndex = 0;

        // Calculate Hamming distance
        function hammingDistance($str1, $str2) {
            $count = 0;
            for ($i = 0; $i < strlen($str1); $i++) {
                if ($str1[$i] != $str2[$i]) $count++;
            }
            return $count;
        }

        // Build DP table
        for ($i = 1; $i < $n; $i++) {
            for ($j = 0; $j < $i; $j++) {
                if ($groups[$i] != $groups[$j] && strlen($words[$i]) == strlen($words[$j]) && hammingDistance($words[$i], $words[$j]) == 1) {
                    if ($dp[$j] + 1 > $dp[$i]) {
                        $dp[$i] = $dp[$j] + 1;
                        $prev[$i] = $j;
                        if ($dp[$i] > $maxLength) {
                            $maxLength = $dp[$i];
                            $lastIndex = $i;
                        }
                    }
                }
            }
        }

        // Reconstruct the longest subsequence
        $result = [];
        while ($lastIndex != -1) {
            array_unshift($result, $words[$lastIndex]);
            $lastIndex = $prev[$lastIndex];
        }

        return $result;
    }
}
